INSERT INTO `tipe_kepribadians` (`id`, `namatipe`, `deskripsi`, `bidang`, `image_tipe`, `created_at`, `updated_at`) VALUES
(1, 'Artistic', 'Orang-orang ini suka bekerja dalam situasi tidak terstruktur dimana mereka dapat menggunakan kreativitas mereka. Bidang yang baik untuk orang Artistik adalah ...- Komunikasi- Seni Rupa dan Pertunjukkan- Fotografi- Radio dan TV- Desain Interior- Arsitektur', 'Bidang Terkait \r\n\r\n- Sumber Daya Alam\r\n- Pelayanan kesehatan\r\n- Teknologi Industri dan Rekayasa\r\n- Seni dan Komunikasi\r\n', '/uploads/TipeKepribadian/artistik_1655131181.jpg', NULL, '2022-06-13 14:58:10'),
(2, 'Enterprising', 'Orang-orang ini suka bekerja dengan orang lain dan menikmati membujuk dan tampil. bidang yang baik untuk orang-orang yang giat adalah ... - Fashion Merchandising - Perumahan - Pemasaran / Penjualan - Hukum - Ilmu Politik - Perdagangan Internasional - Perbankan / Keuangan', 'Bidang Terkait\r\n\r\n- Bisnis \r\n- Layanan Publik dan Manusia \r\n- Seni dan Komunikasi ', 'enterprising.png', NULL, '2022-06-13 11:55:17'),
(3, 'Investigative', 'Orang-orang ini suka menonton, belajar, menganalisis, dan memecahkan masalah. Bidang yang bagus untuk orang Investigatif adalah ... - Biologi kelautan - Rekayasa - Kimia - Pengobatan / Bedah - Ekonomi Konsumen - Psikologi', 'Bidang Terkait\r\n\r\n- Pelayanan Kesehatan \r\n- Bisnis \r\n- Layanan Publik dan Manusia\r\n- Teknologi Industri dan Rekayasa \r\n', 'investigative.png', NULL, '2022-06-13 14:58:34'),
(4, 'Conventional', 'Orang-orang ini sangat berorientasi pada detail, terorganisir dan suka bekerja dengan data. bidang yang bagus untuk orang Konvensional adalah ... - Akuntansi - Pelaporan Pengadilan - Pertanggungan - Administrasi- Rekam Medis - Perbankan - Pengolahan Data', 'Bidang Terkait\r\n\r\n- Pelayanan Kesehatan \r\n- Bisnis \r\n- Teknologi Industri dan Rekayasa ', 'convensional.png', NULL, '2022-06-13 14:58:58'),
(5, 'Realistic', 'Orang-orang ini sering pandai dalam pekerjaan mekanik atau atletik yang bagus untuk orang Realistis adalah ... - Pertanian - Asisten Kesehatan - Komputer- Konstruksi - Mekanik / Masinis- Rekayasa- Makanan dan Perhotelan', 'Bidang Terkait\r\n\r\n- Sumber daya alam \r\n- Pelayanan Kesehatan \r\n- Teknologi Industri dan Rekayasa \r\n- Seni dan Komunikasi ', 'realistic.png', NULL, '2022-06-13 15:01:28'),
(6, 'Social', 'Orang-orang ini lebih suka bekerja dengan orang lain, daripada barang. Jurusan kuliah yang baik untuk orang Sosial adalah ... - Penyuluhan - Perawatan - Terapi Fisik - Perjalanan- Periklanan- Hubungan Masyarakat - Pendidikan', 'Bidang Terkait \r\n\r\n- Pelayanan kesehatan \r\n- Layanan Publik dan Manusia ', 'social.png', NULL, '2022-06-13 15:01:46'),
(7, 'Yo Wis Ben 3', 'zxcvbnm', NULL, NULL, '2022-06-10 07:08:03', '2022-06-12 12:46:07');

